import { Component } from '@angular/core';
import { ModalSequenceService } from '../../services/modal-sequence.service';

@Component({
  selector: 'app-modal-go-session',
  templateUrl: './modal-go-session.component.html',
  styleUrls: ['./modal-go-session.component.scss'],
})
export class ModalGoSessionComponent {
  constructor(private modalSequence: ModalSequenceService) {}

  startSession() {
    this.modalSequence.goTypeSession();
  }
}
<div class="title">Iniciar sessão</div>
<div class="subtitle">
  Para iniciar a sessão, selecione o paciente desejado:
</div>

<div class="search-container">
  <input
    class="styleSearch"
    type="search"
    placeholder="Pesquise seu paciente..."
  />
  <div class="search">
    <img class="search-icon" src="/assets/images/icons/search.svg" />
  </div>
</div>
<div class="list-patients">
  <app-card-patients (click)="startSession()"></app-card-patients>
</div>
